import React from "react";

const Config = () => {
  return (
    <>
      <div
        id="offcanvas-usage"
        uk-offcanvas="overlay: true;flip: true;"
        className="uk-offcanvas">
        <div className="uk-offcanvas-bar uk-width-1-2@m border-left">
          <button
            className="uk-offcanvas-close uk-icon uk-close"
            type="button"
            uk-close=""></button>

          <div className="uk-flex uk-flex-between tm-text-white">
            <div className="uk-text-large">Filter group details</div>
            <div></div>
          </div>

          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim
            ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut
            aliquip ex ea commodo consequat.
          </p>
        </div>
      </div>

      <style jsx>{`
        .border-left {
          border-left: 2px solid black;
        }
      `}</style>
    </>
  );
};

export default Config;
